export function spawnNotifDefault(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit title="Button page" duration="1000">\n                            Notification Message here\n                          </beer-notification-lit>')}export function spawnNotifSuccess(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit type="success" title="Default" duration="4500">\n                                Congratulations class of 2019! You made it. Isn\'t that awesome :D\n                                This message is to be longer than the other ones to show that\n                                the notification will dynamically adjust its height depending on\n                                how much text you have. But then again why would you want\n                                a notification to be an essay lol.\n                          </beer-notification-lit>')}export function spawnNotifWarning(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit type="warning" title="Warning" duration="4500">\n                            Notification Message here\n                          </beer-notification-lit>')}export function spawnNotifInfo(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit type="info" title="Info" duration="4500">\n                            Notification Message here\n                          </beer-notification-lit>')}export function spawnNotifDanger(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit type="danger" title="Danger" duration="4500">\n                            Notification Message here\n                          </beer-notification-lit>')}export function spawnNotifMessage(e,t,n,i,o,a){document.querySelector("body").insertAdjacentHTML("beforeend",'<beer-notification-lit type="message" title="Message" duration="4500">\n                            Notification Message here\n                          </beer-notification-lit>')}